$(document).ready(() => {
	$('.selecting').on('click', '.selecting__head', function () {
		if ($(this).hasClass('open')) {
			$(this).removeClass('open');
			$(this).next().fadeOut();
		} else {
			$('.selecting__head').removeClass('open');
			$('.selecting__list').fadeOut();
			$(this).addClass('open');
			$(this).next().fadeIn();
		}
	});

	$('.selecting').on('click', '.selecting__item', function () {
		$('.selecting__head').removeClass('open');
		$(this).parent().fadeOut();
		$(this).parent().prev().text($(this).text());
		$(this).parent().prev().prev().val($(this).text());
	});

	$(document).click(function (e) {
		if (!$(e.target).closest('.selecting').length) {
			$('.selecting__head').removeClass('open');
			$('.selecting__list').fadeOut();
		}
	});
});
